CREATE TABLE `loan` (
  `id` int NOT NULL AUTO_INCREMENT,
  `loanTypeID` int DEFAULT NULL,
  `userID` int DEFAULT NULL,
  `loanAmount` decimal(10,2) DEFAULT NULL,
  `repaymentAmount` decimal(10,2) DEFAULT NULL,
  `TotalInstallments(Year)` int DEFAULT NULL,
  `AmountPaid` decimal(10,2) DEFAULT NULL,
  `AmountRemaining` decimal(10,2) DEFAULT NULL,
  `RemainingInstallments(Year)` int DEFAULT NULL,
  `Status` varchar(45) DEFAULT NULL,
  `AccountNumber` varchar(10) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `userID` (`userID`),
  KEY `loanTypeID` (`loanTypeID`),
  CONSTRAINT `loan_ibfk_1` FOREIGN KEY (`userID`) REFERENCES `user` (`ID`),
  CONSTRAINT `loan_ibfk_2` FOREIGN KEY (`loanTypeID`) REFERENCES `loantypes` (`ID`)
